import React from 'react'
import './Button.css'

export default props => {
    return(
        <button className={`
            Button
            ${props.operation ? 'operation' : ''}
            ${props.double ? 'double' : ''}
            ${props.triple ? 'triple' : ''}
        `}>
            {props.label}
        </button>
    )
}
